import gsap from "gsap-trial";
import { ScrollTrigger } from "gsap-trial/ScrollTrigger";
import { DrawSVGPlugin } from "gsap-trial/DrawSVGPlugin";
import { MotionPathPlugin } from "gsap-trial/MotionPathPlugin";

gsap.registerPlugin(ScrollTrigger, DrawSVGPlugin, MotionPathPlugin);
gsap.set([".container", "#line-svg"], { autoAlpha: 1 });
gsap.set(
  [
    "#salmorejo-fill",
    "#sagrada-fill",
    "#garlic-fill",
    "#olive-fill",
    "#bread-fill",
    "#salt-fill",
    ".logo",
    "h1",
    ".start",
    ".border",
  ],
  { autoAlpha: 0 }
);

const linesBase = gsap.utils.toArray("#base path");
const linesrunning = gsap.utils.toArray("#running path");
gsap.set([linesBase, linesrunning], { drawSVG: "0% 0%" });
gsap.set([".logo", "h1", ".start"], { y: 40 });

gsap.to([".logo", "h1", ".start", ".border"], {
  autoAlpha: 1,
  y: 0,
  stagger: 0.1,
  ease: "power2.inOut",
  // repeat: -1,
  // duration: 1
});

const texts = [
  ".text-1",
  ".text-2",
  ".text-3",
  ".text-4",
  ".text-5",
  ".text-6",
];
texts.forEach((text) => {
  ScrollTrigger.create({
    trigger: text,
    start: "top 50%",
    toggleActions: "play reverse play reverse",
    animation: gsap.from(text, {
      autoAlpha: 0,
      y: 70,
      duration: 1,
      ease: "sine.out",
    }),
  });
});

function draw(el) {
  let tl = gsap.timeline({ paused: true });
  tl.to(el, { drawSVG: true, duration: 0.5 })
    .to(`${el}-2`, { drawSVG: "100% 100%", duration: 0.5 }, "<")
    .to(
      ".line-circle",
      {
        duration: 0.5,
        motionPath: {
          path: el,
          align: el,
          alignOrigin: [0.5, 0.5],
          autoRotate: true,
        },
      },
      "<"
    )
    .set(`${el}-2`, { autoAlpha: 0 });
  return tl;
}

ScrollTrigger.create({
  trigger: "#base #line-1",
  scrub: true,
  start: "top 50%",
  end: "bottom center",
  //markers: {startColor: "yellow", endColor: "yellow"},
  fastScrollEnd: true,
  onEnter: () =>
    gsap.to(["#sagrada-fill"], {
      autoAlpha: 1,
      stagger: 0.01,
      duration: 1,
    }),
  onEnterBack: () =>
    gsap.to(["#sagrada-fill"], {
      autoAlpha: 0,
      stagger: 0.01,
      duration: 1,
    }),
  animation: draw("#line-1"),
});

ScrollTrigger.create({
  trigger: "#base #line-2",
  scrub: true,
  start: "top+=42.5% 50%",
  end: "bottom center",
  // markers: {startColor: "red", endColor: "red"},
  fastScrollEnd: true,
  onEnter: () =>
    gsap.to(["#garlic-fill"], {
      autoAlpha: 1,
      stagger: 0.01,
      duration: 1,
    }),
  onEnterBack: () =>
    gsap.to(["#garlic-fill"], {
      autoAlpha: 0,
      stagger: 0.01,
      duration: 1,
    }),
  animation: draw("#line-2"),
});

ScrollTrigger.create({
  trigger: "#base #line-3",
  scrub: true,
  start: "top+=19.3% 50%",
  end: "bottom center",
  // markers: {startColor: "blue", endColor: "blue"},
  fastScrollEnd: true,
  animation: draw("#line-3"),
});
ScrollTrigger.create({
  trigger: "#base #line-4",
  scrub: true,
  start: "top+=42.5% 50%",
  end: "bottom center",
  // markers: {startColor: "green", endColor: "green"},
  fastScrollEnd: true,
  onEnter: () =>
    gsap.to(["#bread-fill"], {
      autoAlpha: 1,
      stagger: 0.01,
      duration: 1,
    }),
  onEnterBack: () =>
    gsap.to(["#bread-fill"], {
      autoAlpha: 0,
      stagger: 0.01,
      duration: 1,
    }),
  animation: draw("#line-4"),
});
ScrollTrigger.create({
  trigger: "#base #line-5",
  scrub: true,
  start: "top 50%",
  end: "bottom-=10% center",
  // markers: {startColor: "red", endColor: "red"},
  fastScrollEnd: true,
  animation: draw("#line-5"),
});
ScrollTrigger.create({
  trigger: "#base #line-6",
  scrub: true,
  start: "top+=42% 50%",
  end: "bottom center",
  // markers: {startColor: "blue", endColor: "blue"},
  onEnter: () =>
    gsap.to(["#olive-fill"], {
      autoAlpha: 1,
      stagger: 0.01,
      duration: 1,
    }),
  onEnterBack: () =>
    gsap.to(["#olive-fill"], {
      autoAlpha: 0,
      stagger: 0.01,
      duration: 1,
    }),
  fastScrollEnd: true,
  animation: draw("#line-6"),
});
ScrollTrigger.create({
  trigger: "#base #line-7",
  scrub: true,
  start: "top+=10% 50%",
  end: "bottom center",
  // markers: {startColor: "green", endColor: "green"},
  fastScrollEnd: true,
  animation: draw("#line-7"),
});
ScrollTrigger.create({
  trigger: "#base #line-8",
  scrub: true,
  start: "top+=10% 50%",
  end: "bottom center",
  // markers: {startColor: "green", endColor: "green"},
  onEnter: () => gsap.to("#salt-fill", { autoAlpha: 1, duration: 1 }),
  fastScrollEnd: true,
  onEnterBack: () => gsap.to("#salt-fill", { autoAlpha: 0, duration: 2 }),
  animation: draw("#line-8"),
});

ScrollTrigger.create({
  trigger: "#base #line-9",
  scrub: true,
  start: "top+=10% 50%",
  end: "bottom center",
  // markers: {startColor: "green", endColor: "green"},
  onEnter: () => gsap.to("#salmorejo-fill", { autoAlpha: 1, duration: 1 }),
  fastScrollEnd: true,
  onEnterBack: () => gsap.to("#salmorejo-fill", { autoAlpha: 0, duration: 2 }),
  animation: draw("#line-9"),
});
